-- PROGRAMA
-- PK ==> NUM_VUELO (6 ALFANUMERICO)
--      2primeros compañia + 4siguientes.numero inventado
-- NOMBRE DEBE COINCIDIR CON EL CODIGO DEL AVIÓN
-- AEROPUERTOS DE ATERRIZAJE Y DESPEGUE INVENTADOS
-- DIAS SEMANA INVENTADOS SEPARADOS POR COMAS




-- 5 VUELOS (VOLAR) EN DIFERENTES PROGRAMAS Y AL MENOS 2 DE ELLOS 
-- DEBEN TENER ESCALAS CON SUBIDAS Y BAJADAS DE PASAJEROS.






-- PABLO CREMADES

-- 1- Aeropuertos. Ya he encontrado una pa´gina con todos los aeropuertos del mundo 
-- (http://www.photius.com/wfb2001/airport_codes.html), migrare´ estos datos con algun
-- cambio para facilitaros la vida, pero los u´ltimos detalles os los dejare a 
-- vosotros (ver ejercicios de funciones). Si alguno encuentra otra mejor me lo puede decir.

-- 2- Insercion de las compañias ae´reas obtenidas de 
-- http://airportreview.info/es/codigos- de-companias-aereas/, he tenido que tratar
-- con un par de algoritmos esta informacio´n para que pueda ser almacenable,
-- y aun asi ha quedado pequen~as acciones para vosotros (ver ejercicios de funciones).
 
-- 3- La tabla PROGRAMA tendra inicialmente la PK sera´el numero de vuelo de 6 
-- alfanumericos, obligatoriamente los dos primeros seran el codigo de una compañia
-- que os he pasado y los otros 4 un numero inventado por vosotros empezando por 001
-- (en teoria los impares son aviones que vayan al sur o al oeste, y pares los que vayan
-- al norte o al este, y si tienen menos de 3 digitos, es decir hasta 099 son aviones 
-- de larga distancia), el nombre de compañia debe ser obligatoriamente el que le pongais
-- de codigo, y debe coincidir exactamente como la tabla que os paso en TMP_AEROLINEAS. 
-- Los aeropuertos de aterrizaje y despegue os los inventais. Los dias de la semana 
-- poner los que querais separados por comas (no poner nunca y)







-- 4- Tenéis que realiza la inserción de las tablas DIRECTOR (totalmente inventados por 
-- vosotros), AVION (Esta tabla debe ser lo más real posible, sobretodo los tipos de avión, 
-- los códigos de AVION serán inventados pero deben cumplir que sean 2 letras y 3 
-- números. Cada uno debe entregar 10 inserciones de DIRECTOR y al menos 5 
-- AVIONES. 

