-- diferentes PROGRAMAS, y de los 5 vuelos al menos 2 de esos vuelos deben llevan 
-- ESCALAS, metiendo un mínimo de 2 escalas en cada uno (lo más verosímiles 
-- posibles), con bajadas y subidas de pasajeros. 


